import Layout from '../components/layout';
import build from '../components/pagebuild.json';
import BannerSlider from '../components/banner';
import Theme from '../styles/theme';
import {Span} from '../components/elements';

function Index() {

    return (
        <div id="mybody">
            <BannerSlider
                defaultBackground={Theme.colors.platinum}
                images={['/yellow_house.jpg', '/3foyer.jpg', '/4livingroom.jpg', '/9kitchen.jpg', '/kitchen_living.jpg']}
                height={700}
                cover='rgba(72, 70, 93, .4)'
            />
            <Span background={Theme.colors.platinum} padding={40}>
                <p>Burke Developing is a registered home improvement company located in Quincy Massachusetts</p>
            </Span>
            <style jsx>{`
                #mybody {
                    float: left;
                    min-height: 800px;
                }
                .span_one {
                    float: left;
                    width: 100%;

                }
            `}</style>
        </div>
    )
}

export default Index
